import React from 'react';
import { Route, Routes, Link } from 'react-router-dom';
import SinhvienList from './components/SinhVien/SinhvienList';
import SinhvienForm from './components/SinhVien/SinhvienForm';
import SinhvienDetail from './components/SinhVien/SinhvienDetail';
import BangDiemList from './components/BangDiem/BangDiemList';
import BangDiemDetail from './components/BangDiem/BangDiemDetail';
import BangDiemForm from './components/BangDiem/BangDiemForm';
import StudentInfo from './components/StudentInfo';
import Notifications from './components/Notifications';
import AcademicProgress from './components/AcademicProgress';
import ClassSchedule from './components/ClassSchedule';
import './styles.css';

function App() {
  return (
    <div className="app">
      {/* Header */}
      <header className="header">
        <div className="logo">
          <img src="logo.png" alt="Logo" /> {/* Replace with actual logo */}
        </div>
        <div className="search-bar">
          <input type="text" placeholder="Tìm kiếm..." />
        </div>
        <div className="user-profile">
          <span>NGUYỄN XUÂN LƯỢNG</span>
          <img src="user-icon.png" alt="User" /> {/* Replace with user icon */}
        </div>
      </header>

      <div className="main-content">
        {/* Sidebar */}
        <nav className="sidebar">
          <ul>
            <li>
              <Link to="/app/sinhvien">Danh sách sinh viên</Link>
            </li>
            <li>
              <Link to="/app/add">Thêm sinh viên mới</Link>
            </li>
            <li>
              <Link to="/app/bangdiem">Bảng điểm</Link>
            </li>
            <li>
              <Link to="/app/bangdiemform">Thêm bảng điểm</Link>
            </li>
          </ul>
        </nav>

        {/* Main Dashboard Content */}
        <div className="dashboard">
          <Routes>
            <Route
              path="/"
              element={
                <div className="dashboard-content">
                  <div className="left-section">
                    <StudentInfo />
                    <AcademicProgress />
                  </div>
                  <div className="right-section">
                    <Notifications />
                    <ClassSchedule />
                  </div>
                </div>
              }
            />
            <Route path="/bangdiemform" element={<BangDiemForm />} />
            <Route path="/bangdiem" element={<BangDiemList />} />
            <Route path="/sinhvien" element={<SinhvienList />} />
            <Route path="/add" element={<SinhvienForm />} />
            <Route path="/edit/:id" element={<SinhvienForm />} />
            <Route path="/detail/:id" element={<SinhvienDetail />} />
            <Route path="/bangdiem/:msv" element={<BangDiemDetail />} />
          </Routes>
        </div>
      </div>
    </div>
  );
}

export default App;
